import React from 'react'

export default function DataList ({ dataList }) {
  return (
    <div>
      <h2>DataList</h2>
      <datalist id='dataList'>
        {dataList.map((data, index) => (
          <option key={index} value={data.title} />
        ))}
      </datalist>
    </div>
  )
}
